import React, {useState, useEffect} from 'react';
import Table from 'react-bootstrap/Table';
import {getAmateursResults} from '../user/services/user-services';
import _ from 'lodash';

const Harrastajat = () => {
    const [results, setResults] = useState([]);
    useEffect (() =>{
        getAmateursResults().then(response => setResults(response));
    }, [])

    let personCount = 0; //suorittajalkm:n laskemiseksi
    const personCounter = () => {
        return personCount++;
    };
   
    let personArray = results.map(personCounter);
    console.log(personArray);

    var aResult = _(results)
            .groupBy(x => x.date)
            .map((value, key) => 
            ({date: key,
            results: _.sumBy(value,'times'),
            users: value})).value();

            console.log(aResult);
    
    const professionalsResults = aResult.map((result,index) => 
    <>
    <tr><td>{result.date}</td><td>{result.results}</td>
    <td>{personCount}</td></tr>
    </>
    );
    
    return(
        <>
        <h2 style={{textAlign: "center"}}>Harrastajat</h2><br />
        <div id="table-div">
            <Table striped bordered hover size="sm">
                <thead>
                    <tr>
                    <th>Pvm</th>
                    <th>Suoritukset yhteens√§</th>
                    <th>Suorittajalkm</th>
                    </tr>
                </thead>
                <tbody>
                    {professionalsResults}
                </tbody>
            </Table>
        </div>
        </>
    )
}
export default Harrastajat;
